import {Component, OnInit} from '@angular/core';
import { RouterOutlet } from '@angular/router';
import {LoginPageComponent} from "./pages/login-page/login-page.component";
import {SecretaryPageComponent} from "./pages/secretary-page/secretary-page.component";
import {DomSanitizer} from "@angular/platform-browser";

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [RouterOutlet, LoginPageComponent, SecretaryPageComponent],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})
export class AppComponent implements OnInit {
  title = 'adeverinteforntend';

  pdfData: any;

  constructor(private sanitizer: DomSanitizer) { }

  ngOnInit(): void {
    // Base64 encoded PDF string
    const base64PdfString = ""
    ;

    // Decode Base64 string to binary data
    const binaryPdfString = atob(base64PdfString);

    // Create a Blob object
    const blob = new Blob([binaryPdfString], { type: 'application/pdf' });

    // Create URL for the Blob object
    const url = URL.createObjectURL(blob);

    // Set URL to the iframe source
    this.pdfData = this.sanitizer.bypassSecurityTrustResourceUrl(url);
  }
}
